import { useContext,useState,useEffect } from 'react';
import React from 'react';
const AddEx = ({num}) => {
    //Dyamically increase num of excersises using prop from create
    const [name,setName] = useState('');
    const [sets,setSets] = useState(0);
    const [reps,setReps] = useState(0);
    const [weight,setWeight] = useState(0);
    const number = num;
    const [excersises, setExcerises] = useState([]);
    console.log(number)
 
    

    return ( 
        <div className='excersises' >
            <h2>Add your Excersises</h2>  
            {Array.from({ length: number }, (_, index) => (
                <div key={index} className='excersise'>
                    <h4>Excersise {index +1}</h4>  

                    <label > Excersise Name</label>
                        <input type="text" 
                        required 
                        value = {name}
                        onChange={(e) => setName(e.target.value)} />
                        <br />

                    <label>Weight (lb)</label>
                        <input type="number" 
                        required value={ weight}
                        onChange={(e) => setWeight(e.target.value)}/>
                        <br />

                    <label>Sets</label>
                        <input type="number" 
                        required value={ sets}
                        onChange={(e) => setSets(e.target.value)}
                        />
                        <br />

                    <label>Reps per Set</label>
                        <input type="number" 
                        required value={ reps}
                        onChange={(e) => setReps(e.target.value)}
                        />
                    
                </div>
        ))}
   
        </div>
   
     );
}
 
export default AddEx;
